def test_sha256_sumbytes_empty():
  assert sha256_sumbytes(b"") == b"\xe3\xb0\xc4\x42\x98\xfc\x1c\x14\x9a\xfb\xf4\xc8\x99\x6f\xb9\x24\x27\xae\x41\xe4\x64\x9b\x93\x4c\xa4\x95\x99\x1b\x78\x52\xb8\x55", sha256_sumbytes(b"")
def test_sha256_sumbytes_uickbrownfox():
  assert sha256_sumbytes(b"The quick brown fox jumps over the lazy dog") == b"\xd7\xa8\xfb\xb3\x07\xd7\x80\x94\x69\xca\x9a\xbc\xb0\x08\x2e\x4f\x8d\x56\x51\xe4\x6d\x3c\xdb\x76\x2d\x02\xd0\xbf\x37\xc9\xe5\x92", sha256_sumbytes(b"The quick brown fox jumps over the lazy dog")
def test_sha256_sumbytes_quickbrownfoxdot():
  assert sha256_sumbytes(b"The quick brown fox jumps over the lazy dog.") == b"\xef\x53\x7f\x25\xc8\x95\xbf\xa7\x82\x52\x65\x29\xa9\xb6\x3d\x97\xaa\x63\x15\x64\xd5\xd7\x89\xc2\xb7\x65\x44\x8c\x86\x35\xfb\x6c", sha256_sumbytes(b"The quick brown fox jumps over the lazy dog.")
